import { render } from '@testing-library/react';
import React, { useEffect, useState } from 'react';
import './App.css';

let currentTitle = `The Movie List`;
let popular = false;

const title = <h1 className="App-title">{currentTitle}</h1>;

let categories = <ol className="Categorie-list"><li className="Categorie-list"><button onClick={ActivatePopular}>Popular</button></li><li className="Categorie-list">New Movies</li><li className="Categorie-list">Movies</li></ol>

function ActivatePopular(){

  console.log("activated")
  popular = true;

  console.log(popular)

  App();
}

const Application2 = () => {
  const [categories, setCategories] = useState([])
  const [currentCat, setCurrentCat] = useState(null)

  useEffect(() => {
    axios.get('http://asdf.asdf?cat='+currentCat).then(res => {

    })
  }, [currentCat])


  const onClick = () => {
    setCategories([
      ...categories,
      Math.random()
    ])
  }

  return (
    <div>
      {categories.join(',')}
      <hr/>
      <button onClick={onClick}>Add cat</button>
    </div>
  )
}

const App = () => {

  const [popular, setPopular] = useState(false)

  const ActivatePopular = () => {
    setPopular([
      popular = true
    ])
  }

  console.log(popular)

  if (popular)
  {
    console.log("true")

    categories = <ol className="Categorie-list"><li className="Categorie-list"><button onClick={ActivatePopular}>Not Popular</button></li><li className="Categorie-list">New Movies</li><li className="Categorie-list">Movies</li></ol>
  }
  else if (!popular)
  {
    console.log("false")

    categories = <ol className="Categorie-list"><li className="Categorie-list"><button onClick={ActivatePopular}>Popular</button></li><li className="Categorie-list">New Movies</li><li className="Categorie-list">Movies</li></ol>
  }

  return (
    <div className="App">
      <header className="App-header">
        {title}
        <a
          className="App-link"
          href="https://themoviedb.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          List API
        </a>

        <Application />
        <hr />
        <hr />
        <hr />
        <hr />
        <Application2 />
        {categories}

      </header>
    </div>
  );
}

export default App;
